var canvas = document.getElementById("canvas");

//The code has written for mouse position detect
function getElementPosition(obj) {
  var cursorleft = 0,
    cusorrtop = 0;
  if (obj.offsetParent) {
    do {
      cursorleft += obj.offsetLeft;
      cusorrtop += obj.offsetTop;
    } while ((obj = obj.offsetParent));
    {
      return { x: cursorleft, y: cusorrtop };
    }
  }
  return undefined;
}

//The code has written for mouse location detect
function getEventLocation(element, event) {
  var positoin = getElementPosition(element);

  return {
    x: event.pageX - positoin.x,
    y: event.pageY - positoin.y,
  };
}

// Convart RGB to HEX color code
function rgbToHex(r, g, b) {
  if (r > 255 || g > 255 || b > 255) throw "Invalid color component";
  return ((r << 16) | (g << 8) | b).toString(16);
}

//Create an image using canvas
function drawImageFromWebUrl(sourceurl) {
  var img = new Image();
  img.addEventListener("load", function () {
    // The image can be drawn from any source
    let imgApi = canvas.getContext("2d");
    imgApi.drawImage(
      img,
      0,
      0,
      img.width,
      img.height,
      0,
      0,
      canvas.width,
      canvas.height
    );
  });

  img.setAttribute("src", sourceurl);
}
