function rgbToHsl(r, g, b) {
  r /= 255;
  g /= 255;
  b /= 255;

  let max = Math.max(r, g, b);
  let min = Math.min(r, g, b);
  let h, s, l = (max + min) / 2;

  if (max === min) {
      h = s = 0;
  } else {
      let d = max - min;
      s = l > 0.5 ? Math.round(d / (2 - max - min) * 100) : Math.round(d / (max + min) * 100);
      switch (max) {
          case r: h = Math.round((g - b) / d + (g < b ? 6 : 0)) * 60; break;
          case g: h = Math.round((b - r) / d + 2) * 60; break;
          case b: h = Math.round((r - g) / d + 4) * 60; break;
      }
      h = Math.round(h);
      s = Math.min(100, Math.max(0, s)); // Ensure s is between 0 and 100
      l = Math.round(l * 100); // Round the lightness to the nearest whole number
      l = Math.min(100, Math.max(0, l)); // Ensure l is between 0 and 100
  }

  return [h, s, l];
}


